import React, { useState } from "react";
import ReactDOM from 'react-dom';
import Result from "./Result";
import Home from "./Home";

 function App()
{
    const [home,setHome]=useState(true);

    function setValues()
    {
        setHome(false);
    }
    return (
        <React.StrictMode>

            {home?<Home func="setValues"/>:<Result func="setValues"/>}
          
        </React.StrictMode>
    );
}

export default App;

